import Nav from "@/views/inc/Nav.vue";
export default {
    name: "personal_infor",
    components:{
        Nav
    },
    data(){
            let phonenumbercheck = (rule,value,callback)=>{
                const pat0='^1[0-9]{10}$';
                if (pat0.test(value)){
                    callback();
                    return true;
                }
                else {
                    callback(new Error('请输入以1开头的11位数字'));
                    return false;
                }
            };
            return{
               ruleForm1:{
                  newphonenumber:''
               },
                editRules1:({
                    newphonenumber:[
                        {
                        required: true,
                        message: '请输入手机号码',
                        trigger: 'blur'
                        },
                        {validator: phonenumbercheck,trigger:'blur',}
                    ],
                }),
            dialogVisible1:false,
        }
    },
    methods:{
        submit_check1() {
            this.$refs.ruleForm1.validate((valid) => {
                if (valid) {
                    this.dialogVisible1=false;
                    alert('修改成功!');
                }
                else {
                    return false;
                }
            })
        },
        // submitform(){
